import React, { Component } from "react";
import axios from "axios";

class CarPage extends Component {
  state = {
    cars: []
  };

  componentDidMount() {
    this.getCars();
  }

  getCars = () => {
    axios("http://localhost:5000")
      .then(data => {
        console.log(data.data.cars);
        this.setState({ cars: data.data.cars });
      })
      // .then(({response}) => this.setState({users: response.users}))
      .catch(error => console.log(error));
  };

  showCars = car => (
    <div key={car.id} className="car-model">
      <div className="car-image">
        <img src={require(`../images/${car.image}`)} />
      </div>

      <div className="car-content">
        <h1>
          {car.title} {car.model}
        </h1>
        <div className="mileage">
          mileage: <span>{car.mileage}</span>
        </div>
        <div className="price">
          price: <span>{car.price}</span>
        </div>
        <div className="body">
          body: <span>{car.body}</span>
        </div>
      </div>
    </div>
  );

  render() {
    const { cars } = this.state;
    return (
      <div className="carInventory">
        <div className="car-container">{cars.map(this.showCars)}</div>
      </div>
    );
  }
}

export default CarPage;
